import './dashboard.css'
import Sidebar from './components/Sidebar';
import MainDash from './components/MainDash/MainDash';
function Dashboard(){
    return(
        <div className="App">
            <div className="AppGlass">
                <Sidebar/>
                <MainDash/>
            </div>
        </div>
    )
}
export default Dashboard;
